}

.companies {
  &__list {
    margin-top: 4em;
    & > li {
      display: flex;

      &:not(:last-child) {
        margin-bottom: 4em;
      }
    }
    &::after {
      content: "";
      display: inline-block;
      position: absolute;
      bottom: -15%;
      left: -8%;
