.menu {
  width: 98%;
  height: 95vh;
  background-color: #fff;
  z-index: 21;
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  background-image: url("../images/menu/decor.png");
  background-repeat: no-repeat;
  background-position: left;
  background-size: contain;
  display: flex;
  justify-content: center;
  align-items: center;
  visibility: visible;

  &.hidden {
    visibility: hidden;
  }

  & > ul {
    & > li {
      width: 80%;
      margin: 0 auto 60px auto;
      margin-bottom: 60px;
      position: relative;

      @media (min-width: $desktop-sm-bp) {
        width: 100%;
        margin: 0 0 60px 0;
      }

      &::before {
        content: "";
        background-image: url("../images/menu/1.png");
        background-repeat: no-repeat;
        background-size: contain;
        background-position: center;
        width: 50px;
        height: 50px;
        position: absolute;
        top: -35%;
        left: -5%;
        z-index: -1;
      }
      &:hover::before {
        animation: bounce 0.7s ease-in-out;
      }
      &:nth-child(2)::before {
        background-image: url("../images/menu/2.png");
      }
      &:nth-child(3)::before {
        background-image: url("../images/menu/3.png");
      }
      &:nth-child(4)::before {
        background-image: url("../images/menu/4.png");
      }
      &:last-child::before {
        background-image: url("../images/menu/5.png");
      }

      & > a {
        @include text(
          $color: #403e3e,
          $font-size: calc(26px + 0.5vw),
          $font-weight: 700
        );
        z-index: 1;
        @media (min-width: $desktop-sm-bp) {
          font-size: calc(45px + 0.5vw);
        }
      }
    }
  }
}

@keyframes bounce {
  0%,
  20%,
  60%,
  100% {
    -webkit-transform: translateY(0);
    transform: translateY(0);
  }

  40% {
    -webkit-transform: translateY(-20px);
    transform: scale(1.1) translateY(-20px);
  }

  80% {
    -webkit-transform: translateY(-10px);
    transform: scale(1.05) translateY(-10px);
  }
}

